window.onclick=function(t){if(t.target.matches(".dropbtn")||t.target.parentNode.matches(".dropbtn"))document.getElementById("dropdonwBox").classList.toggle("show");else{var n=document.getElementsByClassName("dropdown-content"),e,s;for(e=0;e<n.length;e++)s=n[e],s.classList.contains("show")&&s.classList.remove("show")}}